import React from 'react';
import './Footer.css';

function Footer() {
    return (
      <div className="Footer">
        <div className="links">
          <p>Sam's Links</p>
            <span>Instagram</span>
            <li>Twitter</li>
            <li>Facebook</li>
            <li>GitHub</li>
          <ul>Nicoles's Links
            <li>Instagram</li>
            <li>Twitter</li>
            <li>Facebook</li>
            <li>GitHub</li>
          </ul>
        </div>
      </div>
    );
}

export default Footer;
